In a Poisson process with rate λ = 6 per day (i.e., 0.25 per hour), the time until the next event is exponential with mean 1/λ = 4 hours. The memoryless property implies that the probability of waiting at least 4 more hours is the same as waiting at least 4 hours from any starting point. Thus:
P(T ≥ 4) = e^{-λ·4} = e^{-6·(4/24)} = e^{-1}.

