For fast x er f(x, y) = k_x, så marginalen for y er f_Y(y) = ∫_0^2 k_x dx = 2k_x. For fast y er f(x, y) = ax + b, så marginalen for x er f_X(x) = ∫_0^1 (ax + b) dy = ax + b. Derfor må 2k_x = ax + b ⇒ k_x = (ax + b)/2. Dermed f(x, y) = (ax + b)/2.

Ved y=0: f(x,0) = ax + b = k_x = (ax + b)/2 ⇒ a = b = 0, hvilket er uenstemmigt med a, b > 0. Derfor er der ikke tilstrækkelig information til at bestemme f(x, y).

